/**
 * @param {character[][]} matrix
 * @return {number}
 */
var maximalSquare = function(matrix) {
    const r = matrix.length;
    const c = matrix[0].length;
    let bestSoFar = 0;
    let score = matrix.map((row) => row.map((val) => parseInt(val)));
    
    for (let i=0; i<r; i++) {
        for (let j=0; j<c; j++) {
            if ('0' == matrix[i][j]) continue;
            if (i != 0 && j != 0) score[i][j] = Math.min(score[i-1][j-1], score[i][j-1], score[i-1][j]) + 1;
            bestSoFar = Math.max(bestSoFar, score[i][j]);
        }
    }

    return bestSoFar * bestSoFar;
};

function checkSquare(matrix, size, r, c) {
    for (let i=r+size-1; i >= r; i--) {
        for (let j=c+size-1; j >= c; j--) {
            if ('0' == (matrix[i][j] ?? '0')) return [i,j];
        }
    }
    return null;
}

function incrementalCheck(matrix, size, r, c) {
    // Function assumes a square size-1 exists at [r,c], checks for one of size
    for (let i=r+size-1; i>=r; i--) {
        if (matrix[i][c+size-1] == '0') {
            return [i, c];
        }
    }
    for (let j=c+size-1; j>=c; j--) {
        if (matrix[r+size-1][j] == '0') {
            return [r, j];
        }
    }
    return null;
}

